import styled from 'styled-components';


const NavigationBar = styled.nav`
  width: 100%;
  height: 20%;
`;

const HomeText = styled.div`
  color: white;
  margin-left: 8%;
  margin-top: 10%;
`;

const Ul = styled.ul`
  width: 30%;
  height: 15%;
`;

const Li = styled.li`
  color: white;
`;

 

    

export default NavigationBar;
